import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import {FC} from "react";
import {BoxTeamPreview} from "./BoxTeam/BoxTeamPreview";
import {BoxMetricPreview} from "./BoxMetric/BoxMetricPreview";
import {BoxReleasePreview} from "./BoxRelease/BoxReleasePreview";
import {BoxComponentPreview} from "./BoxComponent/BoxComponentPreview";

interface BoxProps {
    title: string;
    description: string;
    type: string;
    id: string;
}

export const Box: FC<BoxProps> = (props) => {
    const { type } = props;

    switch (type) {
        case 'team': return <BoxTeamPreview {...props} />
        case 'component': return <BoxComponentPreview {...props} />
        default: return null
    }

};
